class CountryData {
  const CountryData({
    required this.countries,
  });

  final List<CountryModel> countries;

  factory CountryData.fromJson(Map<String, dynamic> json) {
    return CountryData(
      countries: List<CountryModel>.from(
        (json['countries'] as List<dynamic>).map(
          (e) => CountryModel.fromJson(e),
        ),
      ),
    );
  }
}

class CountryModel {
  CountryModel({
    this.name,
    this.emoji,
    this.code,
  });

  CountryModel.fromJson(dynamic json) {
    name = json['name'];
    emoji = json['emoji'];
    code = json['code'];
  }

  String? name;
  String? emoji;
  String? code;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['name'] = name;
    map['emoji'] = emoji;
    map['code'] = code;
    return map;
  }
}

